import Book from "./Book";
function BookList({videos,deleteBook,editBook}){
    return(
        <>
        {videos.map(video=><Book 
                 key = {video.id}
                 id = {video.id}
                 
                 Name = {video.Name}
                 Author = {video.Author}
                 Publisher = {video.Publisher}
                 Availability = {video.Availability}
                 Ledger = {video.Ledger}
                 deleteBook = {deleteBook}
                 editBook={editBook}
                 >

                 </Book>)}
        </>
    )
}
export default BookList;
